import React from 'react';
import { Route, Switch, BrowserRouter } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Dashboard from './components/Dashboard'; // Adjust the path if needed
import './AdminDashboard.css'; // Import the CSS file for AdminDashboard

const AdminDashboard = () => {
    return (
        <div className="admin-dashboard">
            <Sidebar />
            <div className="main-content">
                <Header />
                <>
                    <Route path="/admin/dashboard" component={Dashboard} />
                    <Route path="/admin/events" component={() => <div>Events Page</div>} />
                    <Route path="/admin/users" component={() => <div>Users Page</div>} />
                    <Route path="/admin/reports" component={() => <div>Reports Page</div>} />
                    <Route path="/admin/settings" component={() => <div>Settings Page</div>} />
                    <Route path="/admin" component={Dashboard} />
                </>
            </div>
        </div>
    );
};

export default AdminDashboard;
